import ctypes.wintypes


class HotKey(Thread):
    user32 = ctypes.windll.user32

    def __init__(self, daemon=False):
        super(HotKey, self).__init__(daemon=daemon)

    # _id:注册热键的唯一id，用来区分热键
    def register_key(self, _id, key1, key2):
        if not self.user32.RegisterHotKey(None, _id, key1, key2):
            print("Unable to register id", _id)
            _id += 1
            return self.register_key(_id, key1, key2)
        else:
            return _id

    def run(self):
        global RUN

        # 注册ALT + F6 快捷键
        # _id1 = self.register_key(1090, win32con.MOD_CONTROL, win32con.VK_F6)
        # _id2 = self.register_key(2100, win32con.MOD_CONTROL, win32con.VK_F7)
        _id1 = self.register_key(1090, 0, win32con.VK_F6)
        _id2 = self.register_key(2100, 0, win32con.VK_F7)

        # 以下为检测热键是否被按下，并在最后释放快捷键
        try:
            msg = ctypes.wintypes.MSG()

            while True:
                if self.user32.GetMessageA(ctypes.byref(msg), None, 0, 0) != 0:

                    if msg.message == win32con.WM_HOTKEY:
                        if msg.wParam == _id1:
                            RUN = True
                        if msg.wParam == _id2:
                            RUN = False
                    self.user32.TranslateMessage(ctypes.byref(msg))
                    self.user32.DispatchMessageA(ctypes.byref(msg))

        finally:
            # 必须得释放热键，否则下次就会注册失败，所以当程序异常退出，没有释放热键，
            # 那么下次很可能就没办法注册成功了，这时可以换一个热键测试
            self.user32.UnregisterHotKey(None, _id1)
            self.user32.UnregisterHotKey(None, _id2)


class SystemTray(object):
    # 程序托盘类
    def __init__(self, w_, app_):
        self.app = app_
        self.w = w_
        QApplication.setQuitOnLastWindowClosed(False)  # 禁止默认的closed方法，只能使用qapp.quit()的方法退出程序
        # self.w.show()  # 不设置显示则为启动最小化到托盘
        self.tp = QSystemTrayIcon(self.w)
        self.initUI()
        self.run()

    def initUI(self):
        # 设置托盘图标
        self.tp.setIcon(QIcon(ico_name))

    def quitApp(self):
        # 退出程序

        # self.w.show()  # w.hide() #设置退出时是否显示主窗口
        self.w.hide()

        re = QMessageBox.question(self.w, "提示", "要退出吗臭弟弟?", QMessageBox.Yes |
                                  QMessageBox.No, QMessageBox.No)
        if re == QMessageBox.Yes:
            self.tp.setVisible(False)  # 隐藏托盘控件，托盘图标刷新不及时，提前隐藏
            qApp.quit()  # 退出程序

    def message(self):
        # 提示信息被点击方法
        print("弹出的信息被点击了")

    def act(self, reason):
        # 鼠标点击icon传递的信号会带有一个整形的值，1是表示单击右键，2是双击，3是单击左键，4是用鼠标中键点击
        if reason == 2 or reason == 3:
            self.w.show()

    def run(self):
        # a1 = QAction('显示(Show)', triggered=self.w.show)
        a2 = QAction('退出(Exit)', triggered=self.quitApp)

        tpMenu = QMenu()
        # tpMenu.addAction(a1)
        tpMenu.addAction(a2)
        self.tp.setContextMenu(tpMenu)
        self.tp.show()  # 不调用show不会显示系统托盘消息，图标隐藏无法调用

        # 信息提示
        # 参数1：标题
        # 参数2：内容
        # 参数3：图标（0没有图标 1信息图标 2警告图标 3错误图标），0还是有一个小图标
        self.tp.showMessage('FUCK', 'Oh,Fuck !', icon=0)

        # 绑定提醒信息点击事件
        # self.tp.messageClicked.connect(self.message)

        # 绑定托盘菜单点击事件
        # self.tp.activated.connect(self.act)

        sys.exit(self.app.exec_())  # 持续对app的连接


class Window(QWidget):
    # 主窗口类
    def __init__(self):
        super(Window, self).__init__()
        self.initUI()

    def initUI(self):
        # 主窗口布局
        self.setWindowTitle('MoveMouse')  # 设置标题
        self.setWindowIcon(QIcon(ico_name))  # 设置标题图标
        self.resize(0, 0)  # 设置窗体大小
        self.setFixedSize(self.width(), self.height())  # 固定窗口大小
        # self.center()  # 窗体屏幕居中显示

    def center(self):
        # 窗口居中方法
        # 获得窗口
        qr = self.frameGeometry()
        # 获得屏幕中心点
        cp = QDesktopWidget().availableGeometry().center()
        # 显示到屏幕中心
        qr.moveCenter(cp)
        self.move(qr.topLeft())


def make_ico():
    base64_data = b''

    img_data = base64.b64decode(base64_data)

    with open(ico_name, 'wb') as f:
        f.write(img_data)


class Tasks:

    @staticmethod
    def draw_():
        width, height = pyautogui.size()

        r = 250  # 圆的半径
        # 圆心
        o_x = width / 2
        o_y = height / 2

        pi = 3.1415926

        while True:
            for angle in range(0, 360, 5):  # 利用圆的参数方程
                X = o_x + r * math.sin(angle * pi / 180)
                Y = o_y + r * math.cos(angle * pi / 180)
                pyautogui.moveTo(X, Y, duration=1)
            time.sleep(1800)

    @classmethod
    def task(cls):
        pyautogui.FAILSAFE = False
        width, height = pyautogui.size()

        global RUN

        def task_(x_, y_):
            if RUN:
                cls.move_mouse(x_, y_)
                cls.task_click()
                cls.task_key()
                return 1

        while True:
            for y in range(150, height - 150, 50):
                for x in range(150, width - 150, 50):
                    while True:
                        result = task_(x, y)
                        if result:
                            break
                        else:
                            time.sleep(0.5)

    @staticmethod
    def task_key():
        pyautogui.press(['F', 'u', 'c', 'k', '!', 'space'], interval=0.5)
        time.sleep(0.5)

    @staticmethod
    def task_click():
        pyautogui.click(clicks=1)
        time.sleep(0.5)

    @staticmethod
    def move_mouse(x, y):
        pyautogui.moveTo(x, y, duration=1)
        time.sleep(0.5)


if __name__ == "__main__":
    RUN = False

    ico_name = '.ico'
    make_ico()

    # 创建一个app程序
    app = QApplication(sys.argv)

    # 创建窗口
    win = Window()

    # 启动全局快捷键
    HotKey(daemon=True).start()

    # 开始任务
    Thread(target=Tasks.task, daemon=True).start()

    # 启动托盘
    SystemTray(win, app)
